(function(){"use strict";BX.addCustomEvent(window,"BX.Landing.Block:init",function(a){var t=a.block.querySelector("[data-map]");if(t){if(BX.Landing.getMode()==="edit"){a.forceInit()}else{void new BX.Landing.Provider.Map.GoogleMap({mapContainer:t,theme:BX.Landing.Utils.data(t,"data-map-theme"),roads:BX.Landing.Utils.data(t,"data-map-roads")||[],landmarks:BX.Landing.Utils.data(t,"data-map-landmarks")||[],labels:BX.Landing.Utils.data(t,"data-map-labels")||[],mapOptions:BX.Landing.Utils.data(t,"data-map")})}}})})();